import { NavLink } from 'react-router-dom';

import styles from './NavigationItem.module.css';

function NavigationItem() {
  return (
    <li>
      <NavLink 
        exact
        to='/'
        className={styles.link} activeClassName={styles.active}>Главная</NavLink>
      <NavLink to='/ee'
        className={styles.link} activeClassName={styles.active}>Каталог</NavLink>
      <NavLink to='/rr'
        className={styles.link} activeClassName={styles.active}>Калькулятор</NavLink>
      <NavLink to='/rr'
        className={styles.link} activeClassName={styles.active}>Контакты</NavLink>
      <NavLink 
        to={props.link}
        exact={props.exact}
        activeClassName={classes.active}>{props.children}</NavLink>
    </li>
  )
}

export default NavigationItem
